  PRIMARY KEY (`md_id`,`stock_id`),
  KEY `stock_id_idx` (`stock_id`),
  CONSTRAINT `stock_id_fk` FOREIGN KEY (`stock_id`) REFERENCES `stock` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
